      <div className='login-form'>
        <input
          required
          placeholder='Enter userid'
          type='text'
          name='userid'
          onChange={(e) => {
            setUserid(e.target.value);
          }}
        />
        <input
          placeholder='Enter password'
          type='text'
          name='pass'
          onChange={(e) => {
            setPass(e.target.value);
          }}
        />
      </div>
    </div>
  )
}

